export const AxisLeft = ({ yScale, innerWidth, tickOffset }) => 
    yScale.ticks().map(tickValue => (
        <g className="tick" transform={`translate(0,${yScale(tickValue)})`}>
            <line x2={innerWidth} />
            <text
                style= {{ textAnchor: 'end' }}
                x = {-tickOffset}
                dy = ".32em"
            >
                {tickValue}
            </text>
        </g>
    ));
